def plot_slot_wise(dict_arr_dict, slot_sz, metr, keys_to_plot, aggregate_type, goodlabels, colors_arr):
    fig = plt.figure()
    ax1 = fig.add_subplot(111)
    is_yolo = (sum(list(map(lambda x: "Y" not in x, keys_to_plot))) == 0)
    ind=0
    max_y = 0.0
    max_x = 0.0
    for k in keys_to_plot:
        print("PLOTTING for ", k)
        slot_sum = {}
        slot_ct = {}
        slot_arr = {}
        for run_dict in dict_arr_dict[k]: # run_dict is a dict.
            # print(run_dict.keys(), "KEYS of rd for ", k)
            for rsi in run_dict.keys():
                if rsi not in slot_sum:
                    slot_sum[rsi] = 0.0
                    slot_ct[rsi] = 0
                    slot_arr[rsi] = []
                slot_sum[rsi] += (run_dict[rsi])
                slot_ct[rsi] += 1
                slot_arr[rsi].append( (run_dict[rsi]) )
        slot_id_arr = sorted(slot_sum.keys())
        filtered_slot_id_arr = list(filter(lambda x: len(slot_arr[x]) > 4, slot_id_arr))
        slot_x = [ (slot_sz*(sss+1)) for sss in filtered_slot_id_arr ]
        slot_avg = [ 1000.0*(slot_sum[sss]/slot_ct[sss]) for sss in filtered_slot_id_arr ]
        slot_med = [ 1000.0*np.median( slot_arr[sss] ) for sss in filtered_slot_id_arr ]
        slot_tail = [ 1000.0*np.percentile( slot_arr[sss], 95) for sss in filtered_slot_id_arr]

        max_x = max(max_x, max(slot_x))
        if aggregate_type == "Avg":
            ax1.plot(slot_x, slot_avg, '^-', color=colors_arr[ind], lw=2.0,  ms=6, mec=colors_arr[ind], label=goodlabels[k])
            max_y = max(max_y, max(slot_avg))
        elif aggregate_type == "Median":
            ax1.plot(slot_x, slot_med, '^-', color=colors_arr[ind], lw=2.0,  ms=6, mec=colors_arr[ind], label=goodlabels[k])
            max_y = max(max_y, max(slot_med))
        ind += 1
    # plt.title(aggregate_type + " of " + metr + " (Tail over " + str(int(slot_sz)) + "s slots) vs time", fontsize=20)
    fontsz = 26
    plt.legend(loc='best', prop={"size":26})
    plt.locator_params(axis='y', nbins=20)
    plt.locator_params(axis='x', nbins=20)
    ax1.tick_params(axis='x', which='major', labelsize=fontsz)
    ax1.tick_params(axis='y', which='major', labelsize=fontsz)
    ax1.set_ylabel(metr, fontsize=fontsz)
    ax1.set_xlabel('Time since exploration start (s)', fontsize=fontsz)
    ax1.grid(True)
    plt.ylim(0,max_y*1.05)
    plt.xlim(0, max_x+10.0)
    # plt.savefig()
    plt.savefig(plots_abspath + "/" + plots_folder + "/" + ("Yolo_" if is_yolo else "") + "NO_1c_"+metr+".pdf")
    # plt.savefig("/Users/aaditi2/Desktop/Robotics Project/2020/HotOS/Final Plots SOSP 21/Yolo_NO_1c_"+metr+".pdf")
    plt.show()

